import React from "react";

const CompA = () => {
  return (
    <>
      <select value={num} >
        <option value="1">1</option>
        <option value="1">25</option>
        <option value="1">3</option>
        <option value="1">4</option>
        <option value="1">5</option>
      </select>
    </>
  );
};

export default CompA;
